import React from 'react'
import Header from '../../component/header/Header'
import Navbar from '../../component/navbar/Navbar'
import Posts from '../../component/posts/Posts'
import {gql,useQuery} from "@apollo/client"

const GET_CONTENT = gql`
query MyQuery($_eq: Int_comparison_exp = {}) {
    myBlog_content(where: {id: $_eq}) {
      id
      title
      stories
      created_at
      updated_at
    }
  }
`;

const INSERT_CONTENT = gql`
mutation MyMutation($image_url: String = "", $title: String = "", $stories: String = "") {
  insert_myBlog_content(objects: {title: $title, image_url: $image_url, stories: $stories}) {
    returning {
      title
    }
  }
}
`;

export default function Home() {
    const {data,loading,refetch}=useQuery(GET_CONTENT,{
        variables:{_eq:{}},
        notifyOnNetworkStatusChange:true,
    });

    return (
        <>
          <Navbar/>
          <div className="home">
              <Header/>
              <Posts
              data={data?.myBlog_content}
              />
          </div>
        </>
    )
}
